import React from 'react';

const About = () => {
  return (
    <div>
      <h1>About Us</h1>
      <p>Some text about who we are and what we do.</p>
      <h2>Our Team</h2>
      <div>
        <h3>Jane Doe</h3>
        <p>CEO & Founder</p>
        <p>Some text that describes Jane.</p>
        <p>jane@example.com</p>
      </div>
      <div>
        <h3>Mike Ross</h3>
        <p>Art Director</p>
        <p>Some text that describes Mike.</p>
        <p>mike@example.com</p>
      </div>
    </div>
  );
};

export default About;
